func SetupDefaultKPITemplates(db *gorm.DB, schema string) error {
	customize := GetKPIMeasuresBySet(schema, "enb", "Customize")
	ids := []string{}
	for _, v := range customize {
		ids = append(ids, v.MeasTypeID)
	}
	base := KPITemplate{Schema: schema, Name: "Base", ProductType: "enb", Default: true, PeriodicInterval: 900, SelectType: "DeviceGroup", SelectIds: []uint{0}, MeasTypeIds: ids}
	all := []KPITemplate{base}
	db.Unscoped().Where("\"default\" = ?", true).Delete(&KPITemplate{})
	if result := db.CreateInBatches(all, 100); result.Error != nil {
		return result.Error
	}

	for _, temp := range all {
		if err := tsdb.CreateHyperTableAvgValuesView(db,
			"device_performance_values",
			temp.ViewTableName(),
			fmt.Sprintf("%vm", temp.PeriodicInterval/60),
			"name", "value",
			[]string{"schema", "device_id", "product_type", "oui", "product_class", "serial_number"},
			temp.MeasTypeIds,
			"",
		); err != nil {
			return err
		}
	}
	return nil
}
